    <>
      <div
        style={{
          width: 1280,
          height: 832,
          position: "relative",
          background: "#35465B",
        }}
      >
        <img
          style={{
            width: 1920,
            height: 969,
            left: 0,
            top: 0,
            position: "absolute",
          }}
          src="https://via.placeholder.com/1920x969"
        />
        <div
          style={{
            height: 714,
            paddingRight: 655,
            left: 56,
            top: 44,
            position: "absolute",
            background: "white",
            boxShadow: "0px 72px 80px -48px #223A28",
            borderRadius: 24,
            overflow: "hidden",
            justifyContent: "flex-start",
            alignItems: "center",
            display: "inline-flex",
          }}
        >
          <div
            style={{
              width: 550,
              height: 714,
              position: "relative",
              flexDirection: "column",
              justifyContent: "flex-start",
              alignItems: "flex-start",
              display: "flex",
            }}
          >
            <div style={{ width: 550, height: 714, background: "white" }} />
            <div
              style={{
                justifyContent: "flex-start",
                alignItems: "center",
                gap: 16,
                display: "inline-flex",
              }}
            >
              <div
                style={{
                  width: 48,
                  height: 48,
                  padding: 5.5,
                  justifyContent: "center",
                  alignItems: "center",
                  display: "flex",
                }}
              >
                <div
                  style={{
                    width: 37,
                    height: 37,
                    border: "1.50px black solid",
                  }}
                ></div>
              </div>
              <div
                style={{
                  color: "#355B3E",
                  fontSize: 32,
                  fontFamily: "Inter",
                  fontWeight: "600",
                  lineHeight: 32,
                  wordWrap: "break-word",
                }}
              >
                Chat-Room
              </div>
            </div>
            <div
              style={{
                width: 422,
                color: "#355B3E",
                fontSize: 24,
                fontFamily: "Inter",
                fontWeight: "600",
                lineHeight: 36,
                wordWrap: "break-word",
              }}
            >
              Welcome to Chat-Room, Please login to your account
            </div>
            <div
              style={{
                height: 296,
                flexDirection: "column",
                justifyContent: "flex-start",
                alignItems: "flex-start",
                gap: 24,
                display: "inline-flex",
              }}
            >
              <div
                style={{
                  alignSelf: "stretch",
                  height: 80,
                  flexDirection: "column",
                  justifyContent: "flex-start",
                  alignItems: "flex-start",
                  gap: 8,
                  display: "flex",
                }}
              >
                <div
                  style={{
                    alignSelf: "stretch",
                    color: "#2F3D4C",
                    fontSize: 16,
                    fontFamily: "Inter",
                    fontWeight: "600",
                    lineHeight: 16,
                    wordWrap: "break-word",
                  }}
                >
                  Email
                </div>
                <div
                  style={{
                    alignSelf: "stretch",
                    padding: 16,
                    background: "white",
                    borderRadius: 8,
                    border: "1px #B8D6BF solid",
                    justifyContent: "flex-start",
                    alignItems: "center",
                    gap: 8,
                    display: "inline-flex",
                  }}
                >
                  <div
                    style={{
                      flex: "1 1 0",
                      color: "#355B3E",
                      fontSize: 16,
                      fontFamily: "Inter",
                      fontWeight: "400",
                      lineHeight: 24,
                      wordWrap: "break-word",
                    }}
                  >
                    robert.langster@gmail.com
